adipiscing commoveo cui importunus jugis laoreet pagus praemitto vero. Accumsan cogo damnum molior nibh obruo sagaciter si singularis utinam.\n\nAbluo adipiscing amet iaceo ibidem nulla nutus pagus velit veniam. Exputo ille illum paratus typicus. Ad blandit sudo. Ad augue causa commoveo eu qui wisi zelus. Augue minim sagaciter. Caecus facilisi praesent refoveo suscipit tation utinam. Distineo esse ibidem magna praemitto. Bene distineo feugiat nisl saluto.\n\nAutem comis damnum et ibidem importunus lucidus paulatim wisi. Consectetuer dolore fere genitus paratus pertineo.\n\nAliquam dolus laoreet premo proprius utrum. Aliquam fere odio quibus saepius tamen torqueo. Adipiscing at bene incassum inhibeo lobortis loquor luctus nisl obruo. Adipiscing eu facilisi facilisis meus refero scisco tation. Acsi capto jugis natu te. Conventio lenis nunc pagus pecus quae. Conventio dignissim eros tamen usitas. Dolus euismod exerci jus laoreet loquor si voco.\n\nEum facilisi macto nostrud. Eligo saluto sudo vereor vero. Comis commodo ea iriure obruo proprius saepius. Damnum gilvus immitto quae veniam vulpes.\n\nGemino hos imputo luptatum melior proprius singularis. Dolore ille lucidus macto nobis patria quis. Conventio eros eu nimis quibus.\n\nCamur populus vel. Abbas facilisis illum immitto lucidus melior. Brevitas ut zelus. Abigo blandit facilisi jumentum refoveo volutpat. Eros letalis loquor mos plaga qui quis sagaciter sed. Brevitas mauris velit voco. Commodo metuo quadrum te. Caecus ibidem jugis nimis saepius ymo. Esca immitto minim mos paulatim persto turpis.\n\nBlandit importunus lucidus quia. Immitto lenis nisl quia roto saepius. Conventio gravis jus mos quadrum refero vindico ymo. Ea facilisi importunus obruo typicus vulpes. Autem causa erat ibidem ille jugis meus modo occuro ut. Ad lucidus refoveo. Abbas lobortis quidne tum vulputate. Appellatio esse quidne virtus. Commodo exerci illum luctus metuo premo suscipere tation.\n\n',NULL,'plain_text'),('node','article',0,31,31,'und',0,'Ebenezer Information & Communication Center (EICc)\r\n\r\nEthio Diaspora communication began with the aim of providing timely news, social and cultural information, opinions and analysis to the Ethiopian community. Ethio Diaspora Communication is one of the arms for the EICC. Through this branch, EICC engaged in the broadcast and production of Ethio Diaspora Radio programs. \r\n\r\nEthio Diaspora Radio program is strictly designed to serve this community. Like any other ethnic/community radio ours also by and large remained close to the community it serves. In short, it is for the community by the community. We are trying to bridge the gap in communication and offer forum for sharing ideas, hopes, dreams and concerns. Our main objective is also to provide a marketplace of ideas where our listeners make the ultimate judgment on the merits of ideas presented. We serve as forum for the expressions of diverse view among the communities.\r\n\r\nApart from providing the information about the current events, our radio programs advance the development of community’s sense of social responsibility about social issues, and provide a way through which sense of responsibility can be translated into action. In addition, through our weekly programs we encourage the community to be able to interact with one another, to work as volunteers, and to become members of different initiatives in the community, and share freely their knowledge, experience, skills and their time to make their community a better place to live as well as to play active role in local issues, events and activities. \r\n\r\nMost of us came to America today because of historical accident of one form or another. It’s now of course up to us, both individually and collectively to do everything within our power to go forth and claim a piece of the American dream. That of course, includes fully participating in the American political process. Our media plays vital role in this regard. Through our discussion and programs, we encourage members of our community to integrate smoothly in the society they have come to live and enable them to lead a settled life. \r\n\r\nOn the other hand, the mainstream media has been indifferent about the ethnic communities in the US. So the ethnic media such as ours have become the main voice to the community. We report about the community from inside out, sometimes quite literally. In fact we shouldn’t be surprised to see the ethnic communities who are ‘neglected’ by mainstream media, to develop mistrust. Which by the way, this phenomenon has given the community radio a boost in terms of listeners and supporters. And understanding how to serve the immigrant community is the best way for ethnic media such as ours to survive. \r\n\r\nIt is our hope that our objectives will be achieved through hard work.\r\nWorking for the development of free press particularly free mass media; such as radio, television and newspaper.\r\n\r\nAssessing the need and pressing issues affecting immigrants and connecting them with educational, legal, health and social services through appropriate information.\r\n\r\nDisseminate important and current information among Ethiopians.\r\n\r\nWork to raise the awareness of Ethiopians values, process and institutional mechanism which make democracy key concept among Ethiopians.\r\n\r\nReinforce Ethiopian cultural norms, creativity, values, tradition so that Ethiopians in Diaspora will maintain their identity while contributing to their new communities they live in and their bond with Ethiopia.\r\n\r\nMake available Ethiopian literature and information on and provide forums for free discussions regarding Art and Culture.\r\n\r\nReinforce Ethiopian cultural norms, creativity, values, tradition so that Ethiopian abroad will maintain their identity while contributing to their new communities they live in and their bond with Ethiopia.\r\n\r\nConnects young aspiring writers, artists and photographers with peers around the globe, foster cross-cultural understanding, & promote and defends free press.\r\n\r\nHosting and producing Artistic events to promote Ethiopian creative art work and make discourse on them; to flourish by building a dynamic and powerful artistic community.\r\n\r\nHISTORY : Ethio Diaspora Communication\r\n\r\n‘Ebenezer Promotion’ can be traced to 2001 in Addis Ababa Ethiopia where the primary objective of the agency was to fight the spread of HIV Aids that was manifestly extending its tentacles by employing music and arts that was instrumental in winning the hearts and minds of the youth who stood to lose from this hazardous infliction.\r\n\r\nBack in those years, our organization worked hands in gloves with NGOs to curb the spread of HIV/AIDS and the current dwindling trend of its expansion is a result of the coordinated and cooperative drive of the organizations and primarily of the resort to the use of music and arts it the fight against HIV/AIDS.\r\n\r\nTrue to its tradition of serving the community back home, since Ebenezer Information and Communication Center (EICc) was launched here in the USA, we engaged in the dissemination of community education and information with the view to empower the Diaspora Ethiopians with the capacity to play a positive role in the American Society. To this end Ebenezer promotion, has opened an office in Virginia and is busily engaged in an all out effort to empower the Ethiopian Diaspora to work towards cooperative and to inculcate a sense of patriotism love of the country.\r\n\r\nIn its endeavor to utilize music and art as a medium of spiritual renaissance and renovation Ebenezer promotion has anchored itself in the realm of media patricianly in the area of radio and website to create a sense of coniferous in the ranks of the Ethiopia Diaspora to be a self contained, healthy, with a sense of self-respect and to positively engage in constructive ventures.','','filtered_html'),('node','article',0,32,32,'und',0,'<p>Contact us Eben-Ezer Communication and Information CENTER Ethio Diaspora Communication Alexandria, VA USA Telephone 202-294 7888 POBOX : 13075 Alexandria VA, 22312 Email : admin@ebenezerpromotion.com Website : www.ebenezerpromotion.com www.ethiodiasporaradio.com</p>','','filtered_html'),('node','article',0,33,33,'und',0,'Eben-ezer Promotion Services\r\n\r\nOur agency gives the following services:-\r\n\r\nRadio Programme\r\nAdvertisement\r\nTheater\r\nMusic\r\nTelevision and Radio\r\nDrama Book Review\r\nTalks show\r\nNewsletter\r\nFilms','','filtered_html'),('node','tv_show',0,35,35,'und',0,'<p>Kidist <a href=\"http://ethiodiasporaradio.com\">tesfaye</a></p>','','filtered_html'),('node','article',0,36,36,'und',0,'<p>this is the first pdf test</p>','','filtered_html'),('node','article',0,37,37,'und',0,'<ul><li>ህፃናት ልጆች የክብር እንግዳ የሚሆኑበት እና ከቤተሰቦቻቸው ጋር ገና የሚያከብሩበት የህፃናት ገና ፌስቲቫል ነገ ይከናወናል፡፡</li><li>የፌዴራል ውሃ ሥራዎች ዲዛይንና ቁጥጥር ድርጅት በከርሰ ምድር ውሃ ልማት ዙሪያ የተለያዩ ስራዎችን ለመስራት ውል አደረግኩ አለ፡፡</li><li>በአዲስ አበባ የነበረው የግብፅ ኦርቶዶክስ የህክምና ቡድን ከ3 ሺህ በላይ ህሙማንን ማከሙ ተሰማ፡፡</li><li>የተሻለ ሥራን በኃላፊነት ለመስራት ጥምረትን የመሠረቱት 3ቱ ተቋሞች ለዚሁ እንዲረዳቸው የሰሯቸውን ሥራዎች አስተዋወቁ፡፡</li><li>ክብር ለአረጋዊያን ምግባረ ሰናይ ድርጅት ከ280 ሚሊየን ብር በላይ ለአረጋዊያን ማረፊያ ህንፃ ለመሥራት አስቤያለሁ አለ፡፡</li><li>ኢትዮጵያ የእናቶችን ጤና በመጠበቅና የህፃናትን ሞት በመቀነስ በኩል ውጤታማ የሆነችው በሰጠችው ከፍተኛ ትኩረት እንደሆነ የውጭ ጉዳይ ሚኒስትር ዶክተር ቴዎድሮስ አድሃኖም ተናገሩ፡፡</li><li>ኤልኒኖ በፈጠረው የአየር ንብረት ለውጥ ባስከተለው የድርቅ አደጋ አስቸኳይ የምግብ ድጋፍ የሚያስፈልጋቸው ሰዎች ቁጥር 10.2 ሚሊዮን መድረሱን የኢትዮጵያ መንግስት ተናገረ፡፡</li><li>የኤግዚብሽን ማዕከልና ልማት ድርጅት ከፍተኛ የማስፋፊያ ሥራ ልሰራ ነው አለ፡፡</li><li>በትላንት በሱሉልታ እና አካባቢዋ በተነሳ ግርግር ከ100 በላይ ሰዎች በፖሊስ እጅ ውስጥ እንደሚገኙ ከሱሉልታ ፖሊስ ሰምተናል፡፡</li><li>የመምህር ግማር ወንድሙን ጉዳይ ለማየት የተሰየመው ችሎት ሌላ ተለዋጭ ቀጠሮ ሰጠ፡፡</li><li>ፈቃድ ሣይኖራት ወደ አረብ ሀገር በህገ-ወጥ መንገድ ስትልክ የነበረች ግለሰብ በእሥራት ተቀጣች፡፡</li></ul>','','filtered_html'),('node','article',0,39,39,'und',0,'<p>Published on Jun 19, 2013</p><p>A tutorial video for our latest Drupal module: TB Mega Menu. TB Mega Menu is a Drupal module allows you to create mega menus at ease, it has innovative UI and built on Twitter Bootstrap framework.<br /><br />For more information and download, visit:<br />- Project page: http://drupal.org/project/tb_megamenu<br />- Our website: http://themebrain.com<br /><br />ThemeBrain is a professional Drupal theme service provider, visit our collection for free and premium Drupal themes at http://themebrain.com/drupal-themes<br /><br />Thanks for watching, subscribe to get more Drupal news/update/tutorial video!</p><p>Category</p><p>Science &amp; Technology</p><p>License</p><p>Standard YouTube License</p>','','full_html'),('node','article',0,40,40,'und',0,'<p>yes test one</p>','','filtered_html'),('node','article',0,42,42,'und',0,'<p>US Vice-President Joe Biden told an audience in Ottawa that the world needs \"genuine leaders\" such as Canadian Prime Minister Justin Trudeau.</p><p>The outgoing vice-president spoke during a state dinner and took the opportunity to praise America\'s northern neighbour.</p><p>\"The world is going to spend a lot of time looking to you, Mr Prime Minister\", he told the Canadian leader.</p><p>Mr Biden has been highly critical of US President-elect Donald Trump.</p><p>\"Vive le Canada because we need you very, very badly,\" he told the dinner guests.</p><ul><li>Canada fears \'dangerous\' Trump</li><li>Trudeau open to renegotiating US trade deal</li></ul><p>He went on to describe the self-doubt that liberal leaders across the world are currently experiencing after several political defeats.</p><p>But he praised \"genuine leaders\" including German Chancellor Angela Merkel, saying such statesmen and women are in short supply.</p>','','filtered_html');
