munication center eicc ethio diaspora communication began with the aim of providing timely news social and cultural information opinions and analysis to the ethiopian community ethio diaspora communication is one of the arms for the eicc through this branch eicc engaged in the broadcast and production of ethio diaspora radio programs ethio diaspora radio program is strictly designed to serve this community like any other ethnic community radio ours also by and large remained close to the community it serves in short it is for the community by the community we are trying to bridge the gap in communication and offer forum for sharing ideas hopes dreams and concerns our main objective is also to provide a marketplace of ideas where our listeners make the ultimate judgment on the merits of ideas presented we serve as forum for the expressions of diverse view among the communities apart from providing the information about the current events our radio programs advance the development of community s sense of social responsibility about social issues and provide a way through which sense of responsibility can be translated into action in addition through our weekly programs we encourage the community to be able to interact with one another to work as volunteers and to become members of different initiatives in the community and share freely their knowledge experience skills and their time to make their community a better place to live as well as to play active role in local issues events and activities most of us came to america today because of historical accident of one form or another it s now of course up to us both individually and collectively to do everything within our power to go forth and claim a piece of the american dream that of course includes fully participating in the american political process our media plays vital role in this regard through our discussion and programs we encourage members of our community to integrate smoothly in the society they have come to live and enable them to lead a settled life on the other hand the mainstream media has been indifferent about the ethnic communities in the us so the ethnic media such as ours have become the main voice to the community we report about the community from inside out sometimes quite literally in fact we shouldn t be surprised to see the ethnic communities who are neglected by mainstream media to develop mistrust which by the way this phenomenon has given the community radio a boost in terms of listeners and supporters and understanding how to serve the immigrant community is the best way for ethnic media such as ours to survive it is our hope that our objectives will be achieved through hard work working for the development of free press particularly free mass media such as radio television and newspaper assessing the need and pressing issues affecting immigrants and connecting them with educational legal health and social services through appropriate information disseminate important and current information among ethiopians work to raise the awareness of ethiopians values process and institutional mechanism which make democracy key concept among ethiopians reinforce ethiopian cultural norms creativity values tradition so that ethiopians in diaspora will maintain their identity while contributing to their new communities they live in and their bond with ethiopia make available ethiopian literature and information on and provide forums for free discussions regarding art and culture reinforce ethiopian cultural norms creativity values tradition so that ethiopian abroad will maintain their identity while contributing to their new communities they live in and their bond with ethiopia connects young aspiring writers artists and photographers with peers around the globe foster crosscultural understanding promote and defends free press hosting and producing artistic events to promote ethiopian creative art work and make discourse on them to flourish by building a dynamic and powerful artistic community history ethio diaspora communication ebenezer promotion can be traced to 2001 in addis ababa ethiopia where the primary objective of the agency was to fight the spread of hiv aids that was manifestly extending its tentacles by employing music and arts that was instrumental in winning the hearts and minds of the youth who stood to lose from this hazardous infliction back in those years our organization worked hands in gloves with ngos to curb the spread of hiv aids and the current dwindling trend of its expansion is a result of the coordinated and cooperative drive of the organizations and primarily of the resort to the use of music and arts it the fight against hiv aids true to its tradition of serving the community back home since ebenezer information and communication center eicc was launched here in the usa we engaged in the dissemination of community education and information with the view to empower the diaspora ethiopians with the capacity to play a positive role in the american society to this end ebenezer promotion has opened an office in virginia and is busily engaged in an all out effort to empower the ethiopian diaspora to work towards cooperative and to inculcate a sense of patriotism love of the country in its endeavor to utilize music and art as a medium of spiritual renaissance and renovation ebenezer promotion has anchored itself in the realm of media patricianly in the area of radio and website to create a sense of coniferous in the ranks of the ethiopia diaspora to be a self contained healthy with a sense of selfrespect and to positively engage in constructive ventures  ',0),(32,'node',' contact us contact us ebenezer communication and information center ethio diaspora communication alexandria va usa telephone 202294 7888 pobox 13075 alexandria va 22312 email  admin ebenezerpromotioncom website  wwwebenezerpromotioncom wwwethiodiasporaradiocom ',0),(33,'node',' services ebenezer promotion services our agency gives